import React, { useState } from 'react';
import './DietForm.css';

function DietForm() {
  const [dietName, setDietName] = useState('');
  const [dietType, setDietType] = useState('');
  const [dietSchedule, setDietSchedule] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();

    console.log('Diet Name:', dietName);
    console.log('Diet Type:', dietType);
    console.log('Diet Schedule:', dietSchedule);

    setDietName('');
    setDietType('');
    setDietSchedule('');
  };

  return (
    <div className="diet-form-container">
      <h2>Diet Form</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="dietName">Diet Name:</label>
          <input
            type="text"
            id="dietName"
            value={dietName}
            onChange={(e) => setDietName(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="dietType">Diet Type:</label>
          <input
            type="text"
            id="dietType"
            value={dietType}
            onChange={(e) => setDietType(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="dietSchedule">Diet Schedule:</label>
          <input
            type="text"
            id="dietSchedule"
            value={dietSchedule}
            onChange={(e) => setDietSchedule(e.target.value)}
            placeholder="Enter diet schedule times separated by commas"
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default DietForm;
